import React from 'react';
import { useNavigate } from 'react-router-dom';

const NavBar = ({ children }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div>
      <div className="navigation-box">
        <div className="nav-icon" onClick={() => handleNavigate('/products')}>
          <img src="/images/order.png" alt="Products" />
        </div>
        <div className="nav-icon" onClick={() => handleNavigate('/stores')}>
          <img src="/images/myorders.png" alt="Stores" />
        </div>
        <div className="nav-icon" onClick={handleLogout}>
          <img src="/images/logout.png" alt="Logout" />
        </div>
      </div>
      {children}
    </div>
  );
};

export default NavBar;
